let username ="a";

const Home = () => {

    const[list,setList]=useState([]);
//    const username = localStorage.getItem("username");

    useEffect(()=>{
        try{
        Axios.get("https://localhost:3001/user",{withCredentials:"include"}).then((res)=>{
            setList(res.data);
            username = res.data.username
            console.log(res)
        })}
        catch{
            console.log("a")
        }
    },[]);


    return (

        <div>
            <div className="home">
            <CustomizedDialogs username={username} setList={setList} list={list}/>
            <AlignItemsList list={list} setList={setList}/>
            <div>


            </div>
             </div>
        </div>
    );
};
export default Home;
